import {Component, EventEmitter, Output} from '@angular/core';

@Component({
  selector: 'app-search',
  templateUrl: './search.component.html',
  styleUrls: ['./search.component.css']
})
export class SearchComponent {
  @Output() searchEvent = new EventEmitter<string>();
  @Output() createNewCarEvent = new EventEmitter<void>();

  // Method to emit the event
  onSearch(term: string) {
    this.searchEvent.emit(term);
  }

  createNewCar() {
    this.createNewCarEvent.emit();
  }

  handleSearch(searchTerm: string) {
    // Implement your search logic here
    // For example, filter the car list based on the searchTerm
  }
}
<!-- search.component.html -->
<div class="search-component">
  <button class="create-new-car-button" (click)="createNewCar()">Create New Car</button>
  <input type="text" class="search-input" placeholder="Search cars...">
  <button class="search-button">Search</button>
</div>
